int parse()
{
	int inputsymbol = 0;
	int cstate = 0;
	stack<Sym> symStack;//符号栈
	Sym st;//用作分析时的临时栈顶元素存储变量
	st.symbol = 0;
	st.state = 0;
	symStack.push(st);

	inputsymbol = readToken();
	while (1)
	{
		st = symStack.top();//Sym:symbol(int),state(int)
		int col = signalTable[inputsymbol];
		int result = searchTable(st.state, col);
		if (result == ERROR)//出错
		{
			cout << "Compile Error!" << endl;
			cerr << "存在语法检查错误，有关 "+ getSymbol(inputsymbol) + " 关键词附近的语句有误！" << endl;
			return 0;
		}
		if (result == ACCEPT)
		{
			cout << "Compile sucessfully!" << endl;
			cerr << "语法检查完毕，无错误！" << endl;
			//syntaxTree.root = syntaxTreeStack.top();
			//string filename;
			//cout << "请输入语法树的输出文件名:" << endl;
			//cin >> filename;
			//treefile.open(filename);
			//printMTree("",syntaxTree.root, 0);
			
			return 1;
		}
		if (result < 0)//负数表示为归约项目
		{
			result *= -1;
			int n = producerN[result];//取得该号产生式右部符号数量，以作弹栈用

			TreeNode parentNode = new node;
			st.symbol = pLeftSection[result];//产生式左部的符号
			parentNode->name = getSymbol(st.symbol);
			for (int i = 0; i < n; i++)
			{
				parentNode->child.push_back(syntaxTreeStack.top());
				syntaxTreeStack.pop();
				symStack.pop();
			}
			runaction(result);//执行语义动作
			//产生式左部的符号压栈
			st.state = searchTable(symStack.top().state, signalTable[st.symbol]);
			symStack.push(st);
			syntaxTreeStack.push(parentNode);
		}
		else
		{
			st.symbol = inputsymbol;
			st.state = result;
			symStack.push(st);

			TreeNode newNode = new node;
			newNode->name = buf;
			syntaxTreeStack.push(newNode);
			inputsymbol = readToken();
		}
	}
}
